import { Handle } from 'reactflow';

export const BaseNode = ({ id, label, children, handles = [], style }) => {
  return (
    <div style={{ ...style, position: 'relative', backgroundColor: '#fff' }}>
      <div style={{ fontWeight: 'bold', marginBottom: 8 }}>{label}</div>
      <div>{children}</div>
      {handles.map(({ type, position, id: handleId, style }, index) => (
        <Handle
          key={index}
          type={type}
          position={position}
          id={`${id}-${handleId}`}
          style={{ ...style, zIndex: 1, backgroundColor: '#555' }} // Ensure handles are on top and visible
          isConnectable={true} // Allow connections
        />
      ))}
    </div>
  );
};
